import React from "react";
import { FaChartLine, FaMobileAlt, FaShieldAlt, FaMoneyBillWave, FaClipboardList, FaRobot, FaLightbulb, FaChartBar } from "react-icons/fa";

// Define Card and CardContent locally
const Card = ({ children, className }) => (
  <div className={`bg-white rounded-lg shadow-md p-6 ${className}`}>
    {children}
  </div>
);

const CardContent = ({ children, className }) => (
  <div className={`flex flex-col items-center text-center ${className}`}>
    {children}
  </div>
);

const appsData = [
  {
    name: "Kite",
    description: "A sleek and powerful trading platform with advanced charting and analysis tools.",
    icon: <FaChartLine className="text-blue-500 text-4xl" />,
  },
  {
    name: "Coin",
    description: "Invest in direct mutual funds with zero commission.",
    icon: <FaMobileAlt className="text-green-500 text-4xl" />,
  },
  {
    name: "Console",
    description: "The central dashboard for your Zerodha account, providing reports and insights.",
    icon: <FaShieldAlt className="text-yellow-500 text-4xl" />,
  },
  {
    name: "Varsity",
    description: "A free and comprehensive stock market education platform by Zerodha.",
    icon: <FaClipboardList className="text-purple-500 text-4xl" />,
  },
  {
    name: "GoldenPi",
    description: "Invest in bonds and debentures directly from the Zerodha platform.",
    icon: <FaMoneyBillWave className="text-red-500 text-4xl" />,
  },
  {
    name: "Streak",
    description: "Algo trading without coding. Backtest and deploy strategies easily.",
    icon: <FaRobot className="text-orange-500 text-4xl" />,
  },
  {
    name: "Sensibull",
    description: "Options trading strategies and analysis.",
    icon: <FaChartBar className="text-indigo-500 text-4xl" />,
  },
  {
    name: "Smallcase",
    description: "Thematic investment portfolios to diversify investments.",
    icon: <FaLightbulb className="text-teal-500 text-4xl" />,
  }
];

const faqs = [
  {
    question: "What is Zerodha?",
    answer: "Zerodha is India's largest stock brokerage firm, offering low-cost trading solutions."
  },
  {
    question: "How do I open an account?",
    answer: "You can open an account online by submitting your KYC documents and completing verification."
  },
  {
    question: "What are the charges for trading?",
    answer: "Zerodha offers zero brokerage for equity investments and Rs. 20 per executed order for intraday and F&O trades."
  },
  {
    question: "Is my money safe with Zerodha?",
    answer: "Yes, Zerodha is a registered broker with SEBI and follows all regulatory compliance norms."
  }
];

const tradingTips = [
  "Always do your research before investing in a stock.",
  "Diversify your portfolio to reduce risk.",
  "Don't invest based on emotions; follow a strategy.",
  "Understand the basics of fundamental and technical analysis.",
  "Start with small investments and gradually increase as you gain confidence."
];

const Apps = () => {
  return (
    <div className="p-6 bg-gray-50">
      <h1 className="text-4xl font-bold text-center mb-6 text-gray-800">Zerodha Apps & Tools</h1>
      <p className="text-center text-gray-600 mb-8">Explore various apps and platforms offered by Zerodha to enhance your trading and investment experience.</p>
      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
        {appsData.map((app, index) => (
          <Card key={index} className="transform transition duration-500 hover:scale-105 hover:shadow-2xl">
            <CardContent>
              <div className="mb-4">
                {app.icon}
              </div>
              <h2 className="text-2xl font-semibold mt-4 text-gray-800">{app.name}</h2>
              <p className="text-gray-600 mt-2">{app.description}</p>
            </CardContent>
          </Card>
        ))}
      </div>
      <h2 className="text-3xl font-bold text-center mt-12 mb-6 text-gray-800">FAQ</h2>
      <div className="max-w-3xl mx-auto">
        {faqs.map((faq, index) => (
          <div key={index} className="p-6 mb-4 bg-white rounded-xl shadow-md transform transition duration-500 hover:scale-102 hover:shadow-lg">
            <h3 className="text-xl font-semibold text-gray-800">{faq.question}</h3>
            <p className="text-gray-600 mt-2">{faq.answer}</p>
          </div>
        ))}
      </div>
      <h2 className="text-3xl font-bold text-center mt-12 mb-6 text-gray-800">Trading Tips for Beginners</h2>
      <ul className="max-w-3xl mx-auto list-disc list-inside text-gray-700 bg-white p-6 rounded-xl shadow-md">
        {tradingTips.map((tip, index) => (
          <li key={index} className="mb-3">{tip}</li>
        ))}
      </ul>
    </div>
  );
};

export default Apps;
